def chunks(lst, n):
    """Yield successive n-sized chunks from lst."""
    for i in range(0, len(lst), n):
        yield lst[i:i + n]


def calculate_new_sync_triple(current_list, new_list, symbol_len):
    if len(current_list) == 0:
        return [sum(new_list[0:symbol_len]), sum(new_list[symbol_len:symbol_len * 2]),
                sum(new_list[2 * symbol_len:symbol_len * 3])]
    else:
        return [current_list[0] + sum(new_list[0:symbol_len]),
                current_list[1] + sum(new_list[symbol_len:symbol_len * 2]),
                current_list[2] + sum(new_list[2 * symbol_len:symbol_len * 3])]


def calculate_tresholds(symbol_len, modulation_bits, sync_seq_rep, data):
    num_of_symbols = pow(2, modulation_bits)
    singe_sync_seq_length = symbol_len * 3 * (num_of_symbols - 1)
    full_sync_seq_length = singe_sync_seq_length * sync_seq_rep
    sync_data = data[0:full_sync_seq_length]
    print("len sync data: ", len(sync_data))
    non_zero_sym_values = [str(i) for i in range(num_of_symbols - 1, 0, -1)]
    data_structure = dict.fromkeys(non_zero_sym_values, [])
    for i in range(sync_seq_rep):
        sync = sync_data[i * singe_sync_seq_length:(i + 1) * singe_sync_seq_length]
        sync_triples = list(chunks(sync, 3 * symbol_len))

        for idx, sync_triple in enumerate(sync_triples):
            data_structure[str(num_of_symbols - 1 - idx)] = calculate_new_sync_triple(
                data_structure[str(num_of_symbols - 1 - idx)], sync_triple, symbol_len)

    for k, v in data_structure.items():
        data_structure[k] = [i / sync_seq_rep for i in v]
    return data_structure


symbol_len = 100
modulation_bits = 2
sync_seq_rep = 3
num_of_symbols = pow(2, modulation_bits)

calculate_tresholds(100, 2, 6, sim_result)
user_data = sim_result[symbol_len * 3 * (num_of_symbols - 1) * sync_seq_rep:]
print("expected: ", exp)

out_tab = []
for i in range(0, len(user_data) - symbol_len, symbol_len):
    out_tab.append(sum(user_data[i:i + symbol_len]))

print("summed user data: ", out_tab)
